// Helper Functions
function getDateRangeStart(range) {
    const now = Date.now();
    switch(range){
        case '7d':
            return now - 7 * 24 * 60 * 60 * 1000;
        case '30d':
            return now - 30 * 24 * 60 * 60 * 1000;
        case '90d':
            return now - 90 * 24 * 60 * 60 * 1000;
        case 'all':
        default:
            return null;
    }
}
